text:
my sister's house is an important non-profit founded in 1980 that provides services, programs and resources to empower domestic violence victims and their children to live free from abuse. they are the only shelter-based program serving domestic violence victims in berkeley, charleston and dorchester counties. you can meet the volunteers and learn more about the organization at charleston kidsfair on march 3rd.
#charlestonkidsfair #mysistershouse
@mysistershouseinc @mysistershousecharleston

